    label: 'Understanding Orders',
    url: 'bx8B8xBK1sM'
  },
  {
    label: 'Understanding Payments',
    url: '-1MagX99GOY'
  }
];

export default function Youtube() {
  const isDesktop = useDesktop();
  const width = isDesktop ? '264px' : '248px';
  const height = isDesktop ? '170px' : '169px';

  return (
    <>
      <div className={styles.section}>
        <Swiper
          grabCursor={true}
          initialSlide={0}
          spaceBetween={20}
          className={styles.minheight}
          slidesPerView="auto"
        >
          {items.map((el, i) => (
            <SwiperSlide
              key={i}
              className={styles.card}
            >
              <iframe
                width={width}
                height={height}
                src={`https://www.youtube.com/embed/${el.url}`}
                title="YouTube video player"
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
                className={styles.iframe}
              >
              </iframe>
              <div className={styles.helperText}>
                {el.label}
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>
      {/* {!isDesktop && (
        <div className={styles.section}>
